        // console.log(event);
        alert("hi");
        // this.props.history.push('/');
    }

    render(){
        return(
           <div className="plan-wrapper">
               <form className="box plan-box" onSubmit={this.handleSubmit}>
                    <table className="table">

                    <thead>
                        <tr>
                            <th></th>
                            <th><div>Standard Plan</div></th>
                            <th><div>Premium  Plan</div></th>
