                    </thead>

                    <tbody>
                        <tr>
                            <th><abbr title="Position">General</abbr></th>
                            <th><i className="fas fa-check"  ></i></th>
                            <th><i className="fas fa-check"  ></i></th>
                        </tr>
                    </tbody>
                    <tbody>
                        <tr>
                            <th><abbr title="Position">Specialist</abbr></th>
                            <th> <i className="fas fa-times" ></i></th>
                            <th><i className="fas fa-check"></i></th>
                        </tr>
                    </tbody>
                    <tbody>
                        <tr>
                            <th><abbr title="Position">Physiotherapy</abbr></th>
